import React from 'react'
/*
import s from './Navbar.css'*/
import {NavLink } from 'react-router-dom'

const NavBar = () => {
    return (
        <nav className = {s.nav}> 
            <div>
                <NavLink to='/catalog'>Home</NavLink>
            </div>
            <div>
                <NavLink to='/catalog/countries'>Countries</NavLink>
            </div>
        </nav>
    )
}

export default NavBar;
